import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarHorizontalStyle = styled(motion.div)`
  width: 100vw;
  height: 10vw;
  z-index: 20000;
  position: fixed;
  top: 0;
  left: 0;
  display: none;
  background-color: #191919;
  .icon {
    position: absolute;
    height: 7vw;
    width: 7vw;
    top: 1.5vw;
    right: 5vw;
    background-color: green;
    border-radius: 100%;
  }
  .logo {
    position: absolute;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100%;
    color: #f2c14e;
    cursor: pointer;
    display: flex;
    font-size: 5vw;
  }
  .navbar {
    width: 100vw;
    height: auto;
    max-width: 320px;
    background-color: lawngreen;
    z-index: 1000000000000;
    * {
      font-size: 20px;
    }
  }
  @media (min-width: 800px) {
    height: 100px;
    .icon {
      height: 50px;
      width: 50px;
      top: 25px;
      background-color: lavender;
    }
    .logo {
      font-size: 40px;
    }
  }
  @media (max-width: 1100px) {
    display: block;
  }
`;

const NavbarContent = [
  "home",
  "Five cols",
  "Fewer cols",
  "Templates",
  "Other pages",
];

const NavbarHorizontal = () => {
  return (
    <NavbarHorizontalStyle>
      <div className="icon" />
      <span className="logo"> DeepEnd </span>
      <div className="navbar">
        {NavbarContent.map((e, i) => {
          return <span className="name"> {e} </span>;
        })}
      </div>
    </NavbarHorizontalStyle>
  );
};

export default NavbarHorizontal;
